curl -X DELETE \
  --url '{% case environment %}{% when 'production' %}https://petstore3.swagger.io/api/v3{% else %}envrr{% endcase %}/pet/{{ call["args"]["petId"] | url_encode }}' {% if call["args"]["api_key"] != nil %} \
  -H 'api_key: {{ call["args"]["api_key"] | replace: "'", "'\\''" | replace: "\n", "\\\\n" | replace: "\r", "\\\\r" }}'{% endif %}

curl -X GET \
  --url '{% case environment %}{% when 'production' %}https://petstore3.swagger.io/api/v3{% else %}envrr{% endcase %}/store/inventory' {% if auth["api_key"]["api_key"] != nil %} \
  -H 'api_key: {% if is_masked == true %}{{ auth["api_key"]["api_key"] | mask }}{% else %}{{ auth["api_key"]["api_key"] }}{% endif %}'{% endif %}

